import React, { Component } from 'react';
import CardDeck from '@bit/react-bootstrap.react-bootstrap.card-deck';
import Card from '@bit/react-bootstrap.react-bootstrap.card';
import ReactBootstrapStyle from '@bit/react-bootstrap.react-bootstrap.internal.style-links';
import producto1 from '../image/produc1.jpg';
import producto2 from '../image/produc2.jpg';
import producto3 from '../image/product3.jpg';
import producto4 from '../image/product4.jpg';
import producto5 from '../image/product5.jpg';
import * as ReactBootStrap from "react-bootstrap";


class Example extends Component {
 render() {
 return(
 <div style={{position: "relative", margin: "0 auto", width: "80%"}}>
<CardDeck>
  <Card>
  <Card.Img variant="top" src={producto1} />
    <Card.Body>
      <Card.Title href="#home">PROTESIS SOBRE IMPLANTES</Card.Title>
      
    </Card.Body>
    
  </Card>
  <Card>
  <Card.Img variant="top" src={producto2} />
    <Card.Body>
      <Card.Title href="#home">PROTESIS FIJA DE ALTA ESTÉTICA</Card.Title>
      
    </Card.Body>
    
  </Card>
  <Card>
  <Card.Img variant="top" src={producto3} />    <Card.Body>
      <Card.Title href="#home">PROTESIS REMOVIBLES</Card.Title>
      
    </Card.Body>
    
  </Card>
  <Card>
  <Card.Img variant="top" src={producto4} />    
  <Card.Body>
      <Card.Title href="#home">PROTESIS METAL POCELANA</Card.Title>
      
    </Card.Body>
    
  </Card>
  <Card>
  <Card.Img variant="top" src={producto5} style={{width: "100%", height: "170px"}} />
    <Card.Body>
      <Card.Title  href="#pricing">OTROS TIPOS DE PROTESIS</Card.Title>
      
    </Card.Body>
    
  </Card>
  
  
</CardDeck>
</div>
) } }

export default () => (<div><ReactBootstrapStyle/><Example/></div>)
